body {
    padding: 0;
    font-family: 'Open sans', 'Arial, sans-serif';
}

a {
    text-decoration: none;
    display: block;
    box-sizing: border-box;
    color: $dark-75;


    &:hover {
        text-decoration: none;
    }
}

ul,
ol,
dl, dt, dd {
    list-style: none;
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

p,
li,
nav,
h1,
h2,
h3,
h4,
h5,
h6,
div,
fieldset,
input {
    margin: 0;
    padding: 0;
    box-sizing: border-box;
}

textarea {
    resize: none;
    padding: 0;
}

.visually-hidden {
    position: absolute;
