.toggle {
  color: $dark-50;
  max-width: 230px;
  padding-left: 50px;
  position: relative;
  display: block;

  &__input {
    display: none;

    &:checked + .toggle:before {
      border-color: $dark-25;
    }

    &:checked + .toggle:after {
      background: none;
      background-color: $dark-25;
      left: 4px;
    }
  }

  &:before {
    content: "";
    width: 40px;
    height: 20px;
    border: 1px solid $purple;
    box-sizing: border-box;
    border-radius: 10px;
    position: absolute;
    top: 0;
    left: 0;
  }

  &:after {
    content: "";
    width: 12px;
    height: 12px;
    position: absolute;
    top: 4px;
    left: 24px;
    background: $gradient;
    border-radius: 50%;
  }
}

